Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "مصطلح عام للمساعدة التي تقدمها المنظمات البينحكومية, والمنظمات التطوعية والحكومات الاجنبية في الطوارئ ومرحلة ما بعد الطوارئ, بالنسبة للمساعدات التي يقدمها نظام الأمم المتحدة مباشرة بعد كارثة ما, استخدم \"اغاثة الطوارئ\". استخدم مصطلحات أدق, مثلا, \"إغاثة المنكوبين\" أو \"المعونة الغذائية\" أو \"اللاجئون\" \"المساعدة\" كلما أمكن ذلك", language_id: (Language.find_by name: 'ar').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "对紧急状态中或之后，由政府间组织、志愿者组织和外国政府提供援助的统称。由联合国系统在灾难后提供的紧急援助，用\"紧急救济\"。尽量使用更专指词，如\"灾害救济\"，\"粮食援助\"，\"援助难民\"。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "General term for assistance provided by intergovernmental organizations, voluntary organizations and foreign governments in emergency and post-emergency situations.  For assistance by the UN system in the immediate aftermath of a catastrophe, use EMERGENCY RELIEF.  Use more specific terms, e.g., DISASTER RELIEF, FOOD AID, REFUGEE ASSISTANCE, wherever possible", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Tous secours proposés en cas d'urgence par les organismes internationaux ou bénévoles ou des gouvernements étrangers. Pour l'aide offerte par le système des Nations Unies, utiliser SECOURS D'URGENCE. Utiliser des termes spécifiques si possible SECOURS EN CAS DE CATASTROPHE, AIDE ALIMENTAIRE, ASSISTANCE AUX REFUGIES", language_id: (Language.find_by name: 'fr').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Общий термин для помощи, оказываемой межправительственными организациями, добровольными организациями и иностранными государствами в чрезвычайных ситуациях и на этапе преодоления их последствий. Применительно к помощи, оказываемой системой ООН сразу же вслед за той или иной катастрофой, использовать термин «Чрезвычайная помощь». По возможности следует использовать более конкретные термины, например «Помощь в случае стихийных бедствий», «Продовольственная помощь», «Помощь беженцам»", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Refiérese a la ayuda brindada por organizaciones intergubernamentales, organizaciones voluntarias y gobiernos extranjeros en situaciones de emergencia y después de ésta. Para la ayuda brindada por el sistema de las Naciones Unidas en casos de catástrofes, úsese AYUDA DE EMERGENCIA. Usense términos más específicos cuando sea posible,por ejemplo, SOCORRO EN CASOS DE DESASTRE, AYUDA ALIMENTARIA, ASISTENCIA A REFUGIADOS, etc.", language_id: (Language.find_by name: 'es').id])
