Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "استخدام حتى نيسان 2005  لوصف النزاع ما بين 1990 - 1991 وما بعده، وأيضاً للتدخل العسكري في العراق 2003 حين أدخل مجلس الأمن \" الوضع المتعلق بالعراق\" على جدول أعماله. ومنذ ذلك التاريخ تستخدم \"الحالة بين العراق والكويت\" فقط لحرب الخليج والأمور المتعلقة بها.", language_id: (Language.find_by name: 'ar').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "用于1990-1991的冲突及后果, 和2003年对伊拉克的军事干预。2005年4月, 安理会产生\"有关伊拉克局势\"的议程项目, 从此\"伊拉克-科威特局势\"仅用于1991年海湾战争及其相关问题。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Used both for 1990-1991 conflict and its aftermath and for 2003 military intervention in Iraq until April 2005, when new Security Council agenda item \"The situation concerning Iraq\" was introduced.  From that date, IRAQ-KUWAIT SITUATION is used only for 1991 Gulf War and related issues", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Utilisé à la fois pour le conflit de 1990-1991 et ses conséquences ET pour pour l'intervention militaire en Iraq entamée en 2003 et toujours en cours en avril 2005, quand le nouveau point de l'ordre du jour du Conseil de sécurité intitulé \"La situation concernant l'Iraq\" fut introduit. A partir de cette date, le terme \"SITUATION IRAQ-KOWEIT\" n'est plus utilisé que pour la Guerre du Golfe de 1991 et ce qui en découle.", language_id: (Language.find_by name: 'fr').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Usado tanto para el conflicto 1990-1991 y sus consecuencias como para la intervención militar en Iraq hasta abril de 2005, cuando se introdujo el nuevo tema “La situación relativa al Iraq”. Desde esa fecha en adelante, se utiliza SITUACION EN IRAQ solamente para la Guerra del Golfo de 1991 y temas relacionados.", language_id: (Language.find_by name: 'es').id])
