Resource.create([archetype_id: (Archetype.find_by name: 'altLabel').id, literal: "GUERRA EN IRAQ (2003)", language_id: (Language.find_by name: 'es').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "تتطابق مع بند جدول أعمال مجلس الأمن تحت عنوان \" الحالة المتصلة  بالعراق\". الذي تم إدخاله في نيسان/أبريل 2005. ويستخدم منذ ذلك التاريخ لوصف الحالة المتعلقة بالعمليات الحربية في العراق لعام 2003 وفي أعقاب الحرب أيضاً. أما \"الحالة بين العراق والكويت\" فكانت تستخدم  للوضع قبل ذلك التاريخ", language_id: (Language.find_by name: 'ar').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "自2005年4月, 在安理会议程项目\"有关伊拉克局势\"的通信中开始使用。从那时起，用于有关2003年的军事行动及其后果；这一时间前，只使用“伊拉克－科威特局势”。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Corresponds to Security Council agenda item \"The situation concerning Iraq\", introduced in April 2005. From that date, used for issues pertaining to 2003 military operations in Iraq and aftermath. Prior to that date, only IRAQ-KUWAIT SITUATION was in use.", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Correspond au point de l'ordre du jour du Conseil de sécurité intitulé \"La situation concernant l'Iraq\", introduit en avril 2005. A partir de cette date, ce terme est utilisé pour toutes les sujets relatifs aux opérations militaires en Iraq et leurs conséquences. Avant cette date, seul le terme \"SITUATION IRAQ-KOWEIT\" était utilisé.", language_id: (Language.find_by name: 'fr').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Соответствует вопросу повестки дня Совета Безопасности «Ситуация в отношении Ирака», введенному в апреле 2005 года. С этого времени используется для обозначения вопросов, относящихся к военным операциям 2003 года в Ираке и последующим событиям. Прежде используемый термин", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Corresponde al tema de la agenda del Consejo de Seguridad “La situación relativa al Iraq”, introducida en abril de 2005. Desde esa fecha, utilizada para temas relacionados con las operaciones militares del 2003 en Iraq y sus resultados. Antes de esa fecha, solo se utilizaba SITUACION IRAQ-KUWAIT.", language_id: (Language.find_by name: 'es').id])
