Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "当代基督教神学思潮，认为第三世界的贫困和被压迫来自于外国政府或跨国公司强加给他们的政治和经济结构。教会有责任帮助解放这些社会。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "The belief, in contemporary Christian theology, that poverty and oppression in the Third World result from political and economic structures imposed primarily from the outside by foreign governments or transnational corporations and that it is the responsibility of the church to help liberate these societies", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "La conviction dans la théologie chrétienne actuelle selon laquelle la pauvreté et l'oppression dans le Tiers-Monde résultent des structures politiques et économiques imposées à l'origine depuis l'extérieur par des gouvernements étrangers ou par des sociétés transnationales, et qu'il est de la responsabilité de l'Eglise d'aider à la libération de ces sociétés", language_id: (Language.find_by name: 'fr').id])
