Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Tendencia de la teología cristiana contemporánea, según la cual la pobreza y la opresión del Tercer Mundo se deben a las estructuras políticas y económicas impuestas principalmente desde el exterior, por los gobiernos extranjeros o las empresas transnacionales. Asimismo sostiene que la Iglesia debe asumir la responsabilidad de colaborar en la liberación de esas sociedades", language_id: (Language.find_by name: 'es').id])
