Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "تطوير افتراضات في النظرية الاقتصادية باستخدام أساليب رمزية في التفكير. يستخدم المصطلح عادة للمعالجة المجردة للموضوع. للتحقق من النظرية الاقتصادية والقياس التجريبي للعلاقات الاقتصادية باستخدام الأساليب الرياضية والاحصائية, استخدم \"الاقتصاد القياسي\"", language_id: (Language.find_by name: 'ar').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "用推理的象征性方法发展有关经济理论方面的主张，一般用于对研究对象的抽象处理。用数理和统计方法论证经济理论和实证经济关系，用\"计量经济学\"。", language_id: (Language.find_by name: 'zh').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "The development of propositions in economic theory by symbolic methods of reasoning.  The term is generally used with respect to an abstract treatment of the subject.  For the verification of economic theory and empirical measurement of economic relations by mathematical and statistical methods, use ECONOMETRICS", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Разработка выкладок экономической теории методом символических рассуждений. Термин обычно используется, когда речь идет об абстрактном рассмотрении предмета. Применительно к апробированию экономической теории и эмпирическому измерению экономических отношений математическими и статистическими методами пользоваться рубрикой \"Эконометрия\"", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "El desarrollo de proposiciones en teoría económica mediante métodos simbólicos de razonamiento. El término es usado generalmente en el contexto de un tratamiento abstracto del tema. Para la verificación de la teoría económica y para la medición empírica de las relaciones económicas por medio de métodos matemáticos y estadísticos, úsese ECONOMETRIA", language_id: (Language.find_by name: 'es').id])
